package com.tuisitang.modules.shop.entity;import java.io.Serializable;import net.jeeshop.core.dao.page.PagerModel;/**     * @{#} SessionCount.java *  * <p>Copyright: Copyright(c) 2013 </p>  * <p>Company: TST</p> * @version 1.0 * @author <a href="mailto:paninxb@gmail.com">panin</a>    */public class SessionCount extends PagerModel<SessionCount> implements Serializable {		private static final long serialVersionUID = 1L;		protected Long id;	private String ip;	private String address;	private String starttime;	private int count;	public void clear() {		super.clear();		id = null;		ip = null;		address = null;		starttime = null;		count = 0;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public int getCount() {		return count;	}	public void setCount(int count) {		this.count = count;	}	public String getIp() {		return ip;	}	public void setIp(String ip) {		this.ip = ip;	}	public String getAddress() {		return address;	}	public void setAddress(String address) {		this.address = address;	}	public String getStarttime() {		return starttime;	}	public void setStarttime(String starttime) {		this.starttime = starttime;	}	public static long getSerialversionuid() {		return serialVersionUID;	}}